customCss:
/* 
  ========================================
  [Theme: Noir Romance]
  Concept: Mafia Boss & Pure Love
  Colors: Pitch Black, Burgundy Red, Luxury Gold
  ========================================
*/

/* 1. 폰트 임포트 (우아한 명조체 & 강렬한 헤드라인) */
@import url('https://fonts.googleapis.com/css2?family=Nanum+Myeongjo:wght@400;700;800&family=Playfair+Display:ital,wght@0,400;0,700;1,400&display=swap');

/* 2. 컬러 팔레트 재정의 (CSS 변수) */
:root {
  --col-bg-main: #0a0a0a;       /* 칠흑 같은 검정 */
  --col-bg-sub: #141414;        /* 아주 어두운 차콜 */
  --col-text-main: #e5e5e5;     /* 은은한 실버 화이트 */
  --col-text-muted: #888888;    /* 금속성 회색 */
  --col-primary: #d4af37;       /* 럭셔리 골드 (보스의 권위) */
  --col-accent: #720e1e;        /* 버건디 레드 (장미, 피, 사랑) */
  --col-border: #333333;        /* 어두운 경계선 */
}

/* 3. 전체 레이아웃 및 배경 (핀스트라이프 수트 패턴) */
body {
  background-color: var(--col-bg-main) !important;
  background-image: repeating-linear-gradient(
    90deg,
    transparent,
    transparent 29px,
    rgba(255, 255, 255, 0.03) 30px
  );
}

#root {
  font-family: 'Nanum Myeongjo', serif !important;
  letter-spacing: 0.03em;
}

/* 4. 헤더 (고급스러운 금장 마감) */
header {
  background-color: var(--col-bg-sub) !important;
  border-bottom: 1px solid var(--col-primary) !important;
  box-shadow: 0 4px 15px rgba(0, 0, 0, 0.8) !important;
}

/* 헤더 타이틀 폰트 (영문은 Playfair Display로 중후하게) */
header h2 {
  font-family: 'Playfair Display', serif !important;
  font-style: italic;
  color: var(--col-primary) !important;
  text-shadow: 0 0 10px rgba(212, 175, 55, 0.3);
}

/* 상단 게이지 바 (세련된 씬 스타일) */
header .bg-black\/40 {
  background-color: #000 !important;
  border: 1px solid #444 !important;
}
/* 기력/스트레스 바 색상 변경 */
header .from-emerald-600 { /* 기력 -> 골드 */
  --tw-gradient-from: #d4af37 !important;
  --tw-gradient-to: #8a6e2f !important;
}
header .from-red-600 { /* 스트레스 -> 핏빛 버건디 */
  --tw-gradient-from: #720e1e !important;
  --tw-gradient-to: #4a0000 !important;
}

/* 5. 메인 로그 영역 (시네마틱) */
main {
  background: radial-gradient(circle at center, rgba(114, 14, 30, 0.05), transparent 70%) !important;
}

/* 로그 텍스트 */
main .leading-relaxed {
  font-family: 'Nanum Myeongjo', serif !important;
  font-size: 1rem !important;
  line-height: 1.8 !important;
  color: #d1d1d1 !important;
  text-shadow: 0 1px 2px rgba(0,0,0,0.8);
}

/* 강조 텍스트 (이름, 중요 단어 등) */
main .font-black {
  color: var(--col-primary) !important; /* 중요한 건 금색으로 */
  font-weight: 700 !important;
}

/* 로그 왼쪽 라인 (핏빛 라인) */
main .border-l-2 {
  border-left: 3px solid var(--col-accent) !important;
  background: linear-gradient(90deg, rgba(114, 14, 30, 0.1), transparent) !important;
  margin-bottom: 12px;
}

/* 타임스탬프 */
main .font-mono {
  font-family: 'Playfair Display', serif !important;
  color: var(--col-text-muted) !important;
  font-style: italic;
}

/* 6. ★ 가독성 패치: 태그/뱃지 (악명, 무력 등) ★ */
/* 어두운 배경에서 빛나는 금색 테두리 태그 */
main span[class*="bg-black/40"] {
  background-color: rgba(0, 0, 0, 0.8) !important;
  border: 1px solid var(--col-primary) !important;
  color: var(--col-primary) !important;
  font-family: 'Nanum Myeongjo', serif !important;
  font-weight: bold !important;
  box-shadow: 0 0 5px rgba(212, 175, 55, 0.2) !important;
  text-transform: uppercase;
  padding-bottom: 2px !important;
}

/* LIFE EVENT 타이틀 */
main .text-\[var\(--col-accent\)\] {
  color: var(--col-accent) !important; /* 버건디 레드 */
  font-family: 'Playfair Display', serif !important;
  font-weight: 900 !important;
  letter-spacing: 0.1em !important;
  text-shadow: 0 0 8px rgba(114, 14, 30, 0.6);
  border-bottom: 1px solid var(--col-accent);
  display: inline-block;
  margin-bottom: 4px;
}

/* 7. 하단 컨트롤 패널 (마호가니 책상 느낌) */
.bg-\[var\(--col-bg-sub\)\] {
  background-color: #0f0f0f !important;
  border-top: 1px solid var(--col-border) !important;
  box-shadow: 0 -10px 30px rgba(0,0,0,0.9) !important;
}

/* 주차 슬롯 */
.w-14.h-14 {
  border-color: #333 !important;
  color: #555 !important;
  background-color: #050505 !important;
}

/* 메인 버튼 (1월 스케줄 시작) */
button.bg-\[var\(--col-primary\)\] {
  background: linear-gradient(to bottom, #720e1e, #4a0000) !important; /* 버건디 그라데이션 */
  border: 1px solid #8f1e30 !important;
  color: #fff !important;
  font-family: 'Nanum Myeongjo', serif !important;
  font-weight: 700 !important;
  letter-spacing: 0.1em;
  box-shadow: 0 4px 10px rgba(114, 14, 30, 0.4) !important;
  transition: all 0.3s ease;
}
button.bg-\[var\(--col-primary\)\]:hover {
  box-shadow: 0 0 15px rgba(114, 14, 30, 0.8) !important;
  border-color: #ff3333 !important;
}

/* 8. 행동 버튼 (금장 장식 버튼) */
.grid-cols-5 button {
  background-color: #1a1a1a !important;
  border: 1px solid #333 !important;
  border-radius: 4px !important;
  transition: all 0.3s !important;
}

.grid-cols-5 button:hover {
  border-color: var(--col-primary) !important; /* 호버 시 금색 테두리 */
  box-shadow: inset 0 0 10px rgba(212, 175, 55, 0.1) !important;
  transform: translateY(-2px);
}

/* 버튼 내부 텍스트 */
.grid-cols-5 button span {
  font-family: 'Nanum Myeongjo', serif !important;
}
.grid-cols-5 button .text-xl {
  filter: grayscale(1) sepia(0.5) hue-rotate(5deg); /* 아이콘을 금빛 톤으로 */
}

/* 9. 스크롤바 (얇고 어두운) */
::-webkit-scrollbar { width: 6px; }
::-webkit-scrollbar-track { background: #000; }
::-webkit-scrollbar-thumb { background: #333; border: 1px solid #000; }
::-webkit-scrollbar-thumb:hover { background: var(--col-accent); }


/* 
  ========================================
  [Ending Screen Special Style]
  Target: Final Monologue & Action Buttons
  ========================================
*/

/* 1. 엔딩 독백 박스 (The Letter Box) */
/* 둥근 모서리가 큰 박스를 타겟팅하여 편지봉투 느낌 부여 */
.rounded-\[3rem\] {
  background: linear-gradient(135deg, #1a1a1a, #0d0d0d) !important;
  border: 1px solid var(--col-primary) !important;
  box-shadow: 0 20px 50px rgba(0, 0, 0, 0.9), inset 0 0 30px rgba(0,0,0,0.5) !important;
  position: relative;
  overflow: visible !important;
}

/* 거대 따옴표 장식 (금색으로 변경) */
.rounded-\[3rem\] .text-8xl {
  color: var(--col-primary) !important;
  opacity: 0.2 !important;
  font-family: 'Playfair Display', serif !important;
}

/* 독백 본문 강조 */
.rounded-\[3rem\] p {
  color: #ccc !important;
  text-shadow: 0 1px 2px rgba(0,0,0,0.5);
}
.rounded-\[3rem\] strong {
  color: var(--col-accent) !important; /* Bella, Principessa 등 호칭은 버건디색 */
  font-weight: 800 !important;
  text-decoration: underline;
  text-decoration-color: rgba(114, 14, 30, 0.5);
  text-underline-offset: 4px;
}

/* 2. 발자취 리스트 (Life Footprints) */
/* 이탤릭체 로그들 */
.italic.bg-black\/10 {
  background-color: rgba(20, 20, 20, 0.6) !important;
  border-left-color: var(--col-text-muted) !important; /* 회색 라인 */
  color: #aaa !important;
  transition: all 0.3s;
}
.italic.bg-black\/10:hover {
  background-color: rgba(30, 30, 30, 0.8) !important;
  border-left-color: var(--col-primary) !important; /* 호버시 금색 라인 */
  color: #fff !important;
  transform: translateX(5px);
}

/* 3. 하단 액션 버튼 색상 교체 (중요!) */
/* 원본의 파란색/주황색을 테마색으로 강제 변경 */

/* 저장 버튼 (파란색 -> 짙은 회색/금색) */
button.bg-indigo-600 {
  background-color: #222 !important;
  border: 1px solid #444 !important;
  color: #ddd !important;
}
button.bg-indigo-600:hover {
  border-color: var(--col-primary) !important;
  color: var(--col-primary) !important;
}

/* 다시하기 버튼 (주황색 -> 버건디) */
button.bg-amber-600 {
  background-color: var(--col-accent) !important; /* 피색 */
  color: white !important;
  box-shadow: 0 4px 15px rgba(114, 14, 30, 0.3) !important;
}

/* 새 게임 버튼 (원래 Primary -> 금색 그라데이션 강화) */
button.bg-\[var\(--col-primary\)\] {
  background: linear-gradient(45deg, var(--col-primary), #8a6e2f) !important;
  color: black !important; /* 금색 배경엔 검은 글씨가 가독성 좋음 */
  font-weight: 900 !important;
}

/* 4. 타이틀 영역 */
/* Epilogue 텍스트 */
header .text-\[var\(--col-accent\)\] {
  text-shadow: 0 0 10px rgba(114, 14, 30, 0.5);
}
/* 메인 타이틀 그라데이션 텍스트 */
header .bg-clip-text {
  background-image: linear-gradient(to bottom right, #fff, #999) !important; /* 은색 느낌 */
  -webkit-text-fill-color: transparent !important;
}
